import './App.css';
import Build from './Build/Build.js';
import ContainerItem from './ContainerItem/ContainerItem.js';

function App() {
  const onTheWay = {
    title: "On The Way",
    sets: [
      [
        { name: "ThousandEdge", type: "WeaponsEvolved"},
        { name: "Knife", type: "WeaponsBase"},
        { name: "Bracer", type: "Passive"},
      ],[
        { name: "BloodyTear", type: "WeaponsEvolved"},
        { name: "Whip", type: "WeaponsBase"},
        { name: "HollowHeart", type: "Passive"},
      ],[
        { name: "Fuwalafuwaloo", type: "WeaponsEvolved"},
        { name: "VentoSacro", type: "WeaponsBase"},
      ],[
        { name: "CrimsonShroud", type: "WeaponsEvolved"},
        { name: "Laurel", type: "WeaponsBase"},
        { name: "MetaglioLeft", type: "Passive"},
        { name: "MetaglioRight", type: "Passive"},
      ]

    ]
  }

  return (
    <div className="App">

      <div className="ContainerItem_List">
          <ContainerItem group="OnTheWay"/>
          <ContainerItem group="Blast"/>
          <ContainerItem group="Orbit"/>
          <ContainerItem group="Screen"/>
          <ContainerItem group="Special"/>
        </div>

        <Build />

    </div>
  );
}


export default App;
